import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import './styles/main.css';
import AOS from 'aos';
import 'aos/dist/aos.css';

AOS.init(); // 这里初始化 AOS，只需要做一次

ReactDOM.createRoot(document.getElementById('root')).render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
